import React, { useEffect, useState } from 'react';
import {
  Box,
  Typography,
  Button,
  Container,
  Paper,
  useTheme,
  useMediaQuery,
} from '@mui/material';
import { ArrowDownward, Work, ContactMail } from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';

const Home = () => {
  const [text, setText] = useState('');
  const [isDeleting, setIsDeleting] = useState(false);
  const [loopNum, setLoopNum] = useState(0);
  const [typingSpeed, setTypingSpeed] = useState(150);
  const theme = useTheme();
  const navigate = useNavigate();

  useEffect(() => {
    const roles = ['Computer Science Student', 'Full Stack Developer', 'Problem Solver', 'Tech Enthusiast'];

    const handleType = () => {
      const current = loopNum % roles.length;
      const fullText = roles[current];

      setText(isDeleting 
        ? fullText.substring(0, text.length - 1)
        : fullText.substring(0, text.length + 1)
      );

      setTypingSpeed(isDeleting ? 30 : 150);

      if (!isDeleting && text === fullText) {
        setTimeout(() => setIsDeleting(true), 500);
      } else if (isDeleting && text === '') {
        setIsDeleting(false);
        setLoopNum(loopNum + 1);
      }
    };

    const timer = setTimeout(handleType, typingSpeed);
    return () => clearTimeout(timer);
  }, [text, isDeleting, loopNum, typingSpeed]);

  const codeLines = [
    { keyword: 'const', variable: ' developer', operator: ' = ', string: '"passionate"', punctuation: ';' },
    { keyword: 'function', function: ' createSolutions', punctuation: '() {' },
    { keyword: '  return', string: ' "innovation"', punctuation: ';' },
    { punctuation: '}' }
  ];

  return (
    <Container maxWidth="lg" sx={{ py: 4 }}>
      <Box
        sx={{
          minHeight: '90vh',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
        }}
      >
        <Box
          sx={{
            display: 'grid',
            gridTemplateColumns: { xs: '1fr', md: '1fr 1fr' },
            gap: 4,
            alignItems: 'center',
            width: '100%',
          }}
        >
          {/* Left Content */}
          <Box sx={{ textAlign: { xs: 'center', md: 'left' } }}>
            <Typography
              variant="h1"
              sx={{
                mb: 2,
                background: 'linear-gradient(135deg, #ffffff, #4dabf7)',
                backgroundClip: 'text',
                WebkitBackgroundClip: 'text',
                WebkitTextFillColor: 'transparent',
              }}
            >
              Hi, I'm <Box component="span" sx={{ color: 'primary.main' }}>Your Name</Box>
            </Typography>

            <Box sx={{ minHeight: '60px', mb: 3 }}>
              <Typography
                variant="h3"
                sx={{
                  color: 'primary.main',
                  fontWeight: 500,
                }}
              >
                {text}
                <Box
                  component="span"
                  sx={{
                    animation: 'blink 1s infinite',
                    '@keyframes blink': {
                      '0%, 50%': { opacity: 1 },
                      '51%, 100%': { opacity: 0 },
                    },
                  }}
                >
                  |
                </Box>
              </Typography>
            </Box>

            <Typography
              variant="body1"
              sx={{
                mb: 4,
                maxWidth: 500,
                mx: { xs: 'auto', md: 0 },
                color: 'text.secondary',
                fontSize: '1.1rem',
                lineHeight: 1.6,
              }}
            >
              Passionate about creating innovative solutions through code. 
              Currently pursuing Computer Science and building amazing projects 
              that solve real-world problems.
            </Typography>

            <Box
              sx={{
                display: 'flex',
                gap: 2,
                flexWrap: 'wrap',
                justifyContent: { xs: 'center', md: 'flex-start' },
              }}
            >
              <Button
                variant="contained"
                size="large"
                startIcon={<Work />}
                onClick={() => navigate('/projects')}
                sx={{
                  px: 3,
                  py: 1.5,
                  fontSize: '1rem',
                }}
              >
                View My Work
              </Button>
              <Button
                variant="outlined"
                size="large"
                startIcon={<ContactMail />}
                onClick={() => navigate('/contact')}
                sx={{
                  px: 3,
                  py: 1.5,
                  fontSize: '1rem',
                }}
              >
                Get In Touch
              </Button>
            </Box>
          </Box>

          {/* Right Content - Code Animation */}
          <Box sx={{ display: 'flex', justifyContent: 'center' }}>
            <Paper
              elevation={8}
              sx={{
                p: 3,
                fontFamily: 'monospace',
                fontSize: '1rem',
                lineHeight: 1.8,
                maxWidth: 400,
                width: '100%',
                backgroundColor: 'rgba(15, 1, 52, 0.9)',
                border: '1px solid rgba(74, 171, 247, 0.3)',
                borderRadius: 2,
              }}
            >
              {codeLines.map((line, index) => (
                <Box
                  key={index}
                  sx={{
                    mb: 0.5,
                    opacity: 0,
                    animation: `fadeInUp 0.6s ease forwards`,
                    animationDelay: `${index * 0.2}s`,
                    '@keyframes fadeInUp': {
                      from: {
                        opacity: 0,
                        transform: 'translateY(20px)',
                      },
                      to: {
                        opacity: 1,
                        transform: 'translateY(0)',
                      },
                    },
                  }}
                >
                  {line.keyword && (
                    <Box component="span" sx={{ color: '#a855f7' }}>
                      {line.keyword}
                    </Box>
                  )}
                  {line.variable && (
                    <Box component="span" sx={{ color: '#06b6d4' }}>
                      {line.variable}
                    </Box>
                  )}
                  {line.function && (
                    <Box component="span" sx={{ color: '#10b981' }}>
                      {line.function}
                    </Box>
                  )}
                  {line.operator && (
                    <Box component="span" sx={{ color: '#ef4444' }}>
                      {line.operator}
                    </Box>
                  )}
                  {line.string && (
                    <Box component="span" sx={{ color: '#f59e0b' }}>
                      {line.string}
                    </Box>
                  )}
                  {line.punctuation && (
                    <Box component="span" sx={{ color: 'text.secondary' }}>
                      {line.punctuation}
                    </Box>
                  )}
                </Box>
              ))}
            </Paper>
          </Box>
        </Box>
      </Box>

      {/* Scroll Indicator */}
      <Box
        sx={{
          position: 'absolute',
          bottom: 32,
          left: '50%',
          transform: 'translateX(-50%)',
          textAlign: 'center',
          animation: 'bounce 2s infinite',
          '@keyframes bounce': {
            '0%, 20%, 50%, 80%, 100%': {
              transform: 'translateX(-50%) translateY(0)',
            },
            '40%': {
              transform: 'translateX(-50%) translateY(-10px)',
            },
            '60%': {
              transform: 'translateX(-50%) translateY(-5px)',
            },
          },
        }}
      >
        <Typography variant="body2" sx={{ color: 'text.secondary', mb: 1 }}>
          Scroll Down
        </Typography>
        <ArrowDownward sx={{ color: 'primary.main' }} />
      </Box>
    </Container>
  );
};

export default Home;
